import Foto from '../static/FotoLuisBrito.jpg';
const PersonalData = () => (
    <div className="container">
        <div className="image">
            <img  src={Foto}></img>
        </div>

        <p>A responsive table will display a horizontal scroll bar if the screen is too 
        small to display the full content. Resize the browser window to see the effect:</p>
        <p>To create a responsive table, add a container element (like div) with <strong>overflow-x:auto</strong> around the table element:</p>

    <div>
        <table>
            <tr>
            <th>Nombre</th>
            <th>Apellidos</th>
            <th>Points</th>
            <th>Points</th>
            <th>Points</th>
            <th>Points</th>
            <th>Points</th>
            <th>Points</th>

            </tr>
            <tr>
            <td>Jill</td>
            <td>Smith</td>
            <td>50</td>
            <td>50</td>
            <td>50</td>
            <td>50</td>
            <td>50</td>
            <td>50</td>

            </tr>

        </table>
    </div>
        <div className="datos">

            
            <h1>Datos Personales</h1>
            <ul>
                <li>Nombre: Luis Manuel</li>
                <li>Apellido: Brito Romero</li>
                <li>Telefono: +58 414 092.96.37</li>
                <li>Direccion: Charallave -Edo. Miranda</li>
                <li>Email: lsbrt4@gmail.com</li>
            </ul>
        </div>
    
            <style jsx> {`
            .container{
                border: 1px solid red;
                background-color: gray;
                margin: 20px;
                display: grid;
                grid-template-columns: repeat(auto-fill, minmax(500px, 1fr));
            }
            .datos{
                padding: 20px;
                width: auto;
                text-align: center;
                text-decoration:none;
                border: 1px solid black;
            }
            .image{
                display: block;
                margin-left: auto;
                margin-right: auto;
                width: 40%;
            }
            .image img{
                width: 250px;
                border-radius: 50%;  
                align-items: center;    
            }

            `}
            </style>
    </div>
);

export default PersonalData;
